import React, { Component } from 'react';
import './App.css';
import Axios from 'axios'
import { Routes, Route, Router } from 'react-router-dom';
import Layout from "./Layout";

import Home from './components/sub/home';
import Test from './components/sub/testRoute';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { apiResponse: "" };
  }

  render() {
    Axios({
      method: "GET",
      url: "https://lazy-cyan-basket-clam-veil.cyclic.app/testAPI",
      headers: {
        "Content-Type": "application/json"
      }
    }).then(res => {
      this.setState({ apiResponse: res.data })
    });
    return (
      <Router>
        <Routes>
          <Route key="home" exact path={['/', "/Home"]}  element={<Home/>}>
            <Home />
          </Route>

          <Route key="testAPI" exact path='/testAPI'>
            <Test />
          </Route>
        </Routes>
      </Router>
    )
  };
}

export default App;
